########################################### - [ CREACIÓN BASE DE DATOS ] - ###########################################
DROP DATABASE concesionaria_rymaszewski;

CREATE DATABASE IF NOT EXISTS concesionaria_rymaszewski;
USE concesionaria_rymaszewski;

########################################### - [ CREACIÓN DE LAS TABLAS ] - ###########################################
CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.Employees(
	id_employee INT NOT NULL AUTO_INCREMENT,
    first_name VARCHAR(25),
    last_name VARCHAR(25),
    phone_number BIGINT,
    birthday DATE,
    dni VARCHAR(14),
    PRIMARY KEY(id_employee)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.clients(
	id_client INT NOT NULL AUTO_INCREMENT,
    first_name VARCHAR(25),
    last_name VARCHAR(25),
    phone_number BIGINT,
    dni VARCHAR(14),
    country VARCHAR(30),
    city VARCHAR(30),
    address VARCHAR(30),
    postal_code VARCHAR(15),
    PRIMARY KEY (id_client)
);	

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.payments_methods(
	id_payment_method INT NOT NULL AUTO_INCREMENT,
    payment_method VARCHAR(20) DEFAULT 'credit',
    payment_card VARCHAR(20) DEFAULT 'MasterCard',
    installment_quantity INT DEFAULT 1,
    PRIMARY KEY (id_payment_method)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.manufacturers(
	id_manufacturer INT NOT NULL AUTO_INCREMENT,
	phone_number BIGINT,
    PRIMARY KEY (id_manufacturer)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.colors(
	id_color INT NOT NULL AUTO_INCREMENT,
    description VARCHAR(100),
    metallic BOOL,
    PRIMARY KEY (id_color)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.vehicle_engines(
	id_engine INT NOT NULL AUTO_INCREMENT,
    engine_type VARCHAR(10), -- Diesel, Gasoline, Electric, Hybrid
    PRIMARY KEY (id_engine)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.cars_workshop(
	id_car_workshop INT NOT NULL AUTO_INCREMENT,
	phone_number BIGINT,
    city VARCHAR(30),
    address VARCHAR(30),
    PRIMARY KEY (id_car_workshop)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.vehicles(
	id_vehicle INT NOT NULL AUTO_INCREMENT,
    id_manufacturer INT,
    id_engine INT,
    id_color INT,
    fabrication_date DATE,
    accesories VARCHAR(200),
    patent VARCHAR(10) UNIQUE,
    brand VARCHAR(25),
    model VARCHAR(25),
    traction CHAR(3), -- FWD, RWD, 4WD
    vehicle_status VARCHAR(18), 
    km NUMERIC,
    price DECIMAL(11, 2),
    PRIMARY KEY (id_vehicle),
    FOREIGN KEY (id_manufacturer) REFERENCES concesionaria_rymaszewski.manufacturers (id_manufacturer),
    FOREIGN KEY (id_engine) REFERENCES concesionaria_rymaszewski.vehicle_engines (id_engine),
    FOREIGN KEY (id_color) REFERENCES concesionaria_rymaszewski.colors (id_color)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.reviews(
	id_review INT NOT NULL AUTO_INCREMENT,
    id_vehicle INT NOT NULL,
    id_car_workshop INT,
    review_date DATE DEFAULT (CURRENT_DATE()),
    description VARCHAR(200),
    price DECIMAL(11,2),
    PRIMARY KEY (id_review),
    FOREIGN KEY (id_vehicle) REFERENCES concesionaria_rymaszewski.vehicles (id_vehicle),
    FOREIGN KEY (id_car_workshop) REFERENCES concesionaria_rymaszewski.cars_workshop (id_car_workshop)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.orders(
	id_order INT NOT NULL AUTO_INCREMENT,
    id_employee INT,
    id_client INT,
    id_payment_method INT,
    order_date DATE,
    PRIMARY KEY (id_order),
    FOREIGN KEY (id_employee) REFERENCES concesionaria_rymaszewski.employees (id_employee),
    FOREIGN KEY (id_client) REFERENCES concesionaria_rymaszewski.clients (id_client),
    FOREIGN KEY (id_payment_method) REFERENCES concesionaria_rymaszewski.payments_methods (id_payment_method)
);

CREATE TABLE IF NOT EXISTS concesionaria_rymaszewski.order_details(
	id_order_detail INT NOT NULL AUTO_INCREMENT,
    id_order INT,
    id_vehicle INT,
    quantity NUMERIC,
    PRIMARY KEY(id_order_detail),
    FOREIGN KEY (id_order) REFERENCES concesionaria_rymaszewski.orders (id_order),
    FOREIGN KEY (id_vehicle) REFERENCES concesionaria_rymaszewski.vehicles (id_vehicle)
);

