########################################### - [ VIEWS ] - ###########################################

-- 1) Vista que devuelve el top 5 de los empleados que mas hayan generado
-- ya sea por vender un vehiculo muy caro, o muchos barato, la vista calcula la cantidad de vehiculos venidos
-- por su valor y luego hace una sumatoria de cada order.
CREATE VIEW vw_top_5_employees AS (
	SELECT o.id_employee,
		   (SELECT e.first_name FROM employees e WHERE o.id_employee = e.id_employee) AS first_name_employee,
		   (SELECT e.last_name FROM employees e WHERE o.id_employee = e.id_employee) AS last_name_employee,
		   SUM(v.price * od.quantity) as total_generado
	FROM order_details od
	JOIN vehicles v
	ON v.id_vehicle = od.id_vehicle
	JOIN orders o
	ON od.id_order =  o.id_order
	GROUP BY id_employee
	ORDER BY total_generado DESC
	LIMIT 5
);

-- 2) Muestra informacion sobre los top 3 autos con menos dinero generado.
CREATE VIEW vw_top_3_vehiculos_menos_ventas AS (
	SELECT v.id_vehicle,
	   (SELECT v.brand FROM vehicles v WHERE od.id_vehicle = v.id_vehicle) as brand,
	   (SELECT v.model FROM vehicles v WHERE od.id_vehicle = v.id_vehicle) as model,
	   SUM(v.price * od.quantity) as total_generado
	FROM order_details od
	JOIN vehicles v
	ON v.id_vehicle = od.id_vehicle
	JOIN orders o
	ON od.id_order =  o.id_order
	GROUP BY v.id_vehicle
	ORDER BY total_generado ASC
	LIMIT 3
);

-- 3) Crea una vista para los clientes que hablan español y no tienen un postal_code
-- por ejemplo para enviarles una notificacion para que completen ese campo.
CREATE VIEW vw_clientes_esp AS (
	SELECT *
	FROM clients c 
	WHERE country in ('Argentina', 'España', 'Mexico', 'Peru', 'Bolivia', 'Colombia')
	AND postal_code = '' or postal_code = NULL
);

-- 4) Devuelve una lista con la informacion de los 5 vehiculos que mas van al taller.
CREATE VIEW vw_top_5_ida_taller AS (
	SELECT r.id_vehicle, 
		   v.brand,
		   v.model,
		   count(r.id_vehicle) as ida_taller
	FROM reviews r
	JOIN vehicles v
	ON v.id_vehicle = r.id_vehicle
	GROUP BY id_vehicle
	ORDER BY ida_taller DESC
	LIMIT 5
);

-- 5) Devuelve informacion general de un vehiculo
CREATE VIEW vw_info_vehicle AS (
	SELECT v.id_vehicle, 
		   ve.engine_type, 
		   v.brand, 
		   v.model,
		   c.description as color
	FROM vehicles v
	JOIN vehicle_engines ve
	ON v.id_engine = ve.id_engine
	JOIN colors c
	ON v.id_color = c.id_color
	ORDER BY id_vehicle
);

########################################### - [ FUNCTIONS ] - #######################################

-- 1) Muestra el precio con el iva + costos extras para comprar un vehiculo 
DELIMITER //
CREATE FUNCTION `f_vehiculo_iva` (`vehicle_id` INT) RETURNS DECIMAL (11, 2)
NO SQL
BEGIN
	DECLARE precio DECIMAL(11, 2);
    SET precio = ((SELECT price FROM vehicles WHERE id_vehicle = vehicle_id) + ((SELECT price FROM vehicles WHERE id_vehicle = vehicle_id) * (21 / 100)));
    RETURN precio;
END;
//
DELIMITER ;

