-- 2) Recibe el id de un vehiculo y devuelve un 1 si esta habilitado a recibir un descuento o un 0 si no
-- Si el vehiculo fue mas de 2 veces al taller, esta habilitado para el descuento

DELIMITER //
CREATE FUNCTION `f_descuento` (`vehicle_id` INT) RETURNS TINYINT(1)
NO SQL 
BEGIN
	DECLARE `discount` TINYINT(1);
    SET discount = IF((
		SELECT count(*) as times_in_workshop 
        FROM reviews 
        WHERE id_vehicle = vehicle_id 
        GROUP BY id_vehicle
        ) > 2, 1, 0);
        -- El WHERE devuelve la cantidad de veces que un vehiculo tuvo una review (Fue al taller)
	RETURN discount;
END;
//
DELIMITER ;

