########################################### - [ STORED PROCEDURES ] - ###############################

-- 1) Stored Procedure: Ordena la tabla Vehiculos por un campo y orden especifico pasado como parametro, 
DROP PROCEDURE IF EXISTS sp_ordenar_vehicles;

DELIMITER //
CREATE PROCEDURE `sp_ordenar_vehicles` (IN campo VARCHAR(25), IN orden VARCHAR(4))
BEGIN
	IF (orden != 'ASC' AND orden != 'DESC') THEN
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El parametro orden debe ser: ASC o DESC';
	ELSE
		SET @ordenar = CONCAT('SELECT * FROM vehicles', ' ', 'ORDER BY', ' ', campo,' ', orden);
    END IF;
    
    PREPARE consulta FROM @ordenar;
    EXECUTE consulta;
    DEALLOCATE PREPARE consulta;
END //
DELIMITER ;

-- 2) Stored Procedure: Inserta una nueva orden, tomando como parametros de entrada:
/*
	* id_employee
    * id_client
    * id_payment_method
    Verfica que los 3 datos existan en sus respectivas tablas y le agrega la fecha del momento.

*/
DROP PROCEDURE IF EXISTS sp_insertar_order;

DELIMITER //
CREATE PROCEDURE `sp_insertar_order` (IN sp_id_employee INT, 
									  IN sp_id_client INT,
                                      IN sp_id_payment_method INT)
BEGIN
	IF (NOT
		(SELECT sp_id_employee in (SELECT id_employee FROM employees)) AND
		(SELECT sp_id_client in (SELECT id_client FROM clients)) AND
		(SELECT sp_id_payment_method in (SELECT id_payment_method FROM payments_methods)) 
	) THEN
	SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Parametro/s invalido/s, corrobore que existan todos los id.';
    ELSE
	END IF;
END
// 
DELIMITER ;

