########################################### - [ TRIGGERS ] - ########################################

# Tabla log encargada de almacenar la informacion adicional de las acciones realizadas sobre la tabla VEHICULO. 
-- Almacenará los datos PREVIOS a la modificacion de los mismos. (Como un historial de los datos originales.)
DROP TABLE IF EXISTS `log_vehicles`;

CREATE TABLE log_vehicles (
	-- Datos del log
	id_log_vehicle INT AUTO_INCREMENT,
    action_description VARCHAR(255),
    action_user VARCHAR(100),
    action_date DATETIME,
    
    -- Datos del vehiculo 
    id_vehicle INT,
    id_manufacturer INT,
    id_engine INT,
    id_color INT,
    fabrication_date DATE,
    accesories VARCHAR(200),
    patent VARCHAR(10),
    brand VARCHAR(25),
    model VARCHAR(25),
    traction CHAR(3),
    vehicle_status VARCHAR(18), 
    km NUMERIC,
    price DECIMAL(11, 2),
    PRIMARY KEY (id_log_vehicle)
);

-- 1) Trigger encargado de llevar un registro de la MODIFICACION de un vehiculo.
-- b: before
-- u: update

DROP TRIGGER IF EXISTS `b_u_vehicles`
DELIMITER //
CREATE TRIGGER `b_u_vehicles`
BEFORE UPDATE ON vehicles
FOR EACH ROW
BEGIN
							  id_engine, id_color, fabrication_date, accesories,  patent, brand, model, traction, 
                              vehicle_status, km, price)
                              
	VALUES (DEFAULT, 'se modifico el registro', USER(), NOW(), old.id_vehicle, old.id_manufacturer, old.id_engine, 
			old.id_color, old.fabrication_date, old.accesories, old.patent, old.brand, old.model, old.traction, 
            old.vehicle_status, old.km, old.price);
END;
// 
DELIMITER ;

