-- 2) Trigger encargado de llevar un registro de la ELIMINACION de un registro vehiculo.
DROP TRIGGER IF EXISTS `a_d_vehicles`
DELIMITER //
CREATE TRIGGER `a_d_vehicles`
AFTER DELETE ON vehicles
FOR EACH ROW
BEGIN
							  id_engine, id_color, fabrication_date, accesories,  patent, brand, model, traction, 
                              vehicle_status, km, price)
                              
	VALUES (DEFAULT, 'se elimino el registro', USER(), NOW(), old.id_vehicle, old.id_manufacturer, old.id_engine, 
			old.id_color, old.fabrication_date, old.accesories, old.patent, old.brand, old.model, old.traction, 
            old.vehicle_status, old.km, old.price);
END;
// 
DELIMITER ;

